import React from "react";
import Button from '@material-ui/core/Button';

import TextField from '@material-ui/core/TextField';

const Contact = ({ setForm, formData, setStep }) => {
  const { phone, email } = formData;

  return (
    <div className="form">
      <h3>Contact </h3>
      <TextField label="Phone" name="phone" value={phone} onChange={setForm} />
      <TextField label="E-mail" name="email" value={email} onChange={setForm} />
      <div>
        <Button onClick={setStep('Address')}>Previous</Button>
        <Button onClick={setStep('Review')}>Next</Button>
      </div>
    </div>
  );
};

export default Contact;
